import './topbar.scss';
import { Person, Mail } from '@material-ui/icons';
const Topbar = () => {
  return (
    <>
      <div className="topbar">
        <div className="wrapper">
          <div className="left">
            <a href="#intro" className="logo">
              Shyam
            </a>
            <div className="itemContainer"></div>
          </div>
          <div className="rght"></div>
        </div>
      </div>
    </>
  );
};

export default Topbar;
